import React from 'react';

function Sidebar() {
  return (
    <div className="sidebar fixed inset-y-0 left-0 w-44 flex flex-col bg-black shadow-lg">
      {/* Logo and nav */}
      <div className="px-8 py-4">
        <div className="text-white text-3xl font-bold">travel</div>
        <nav className="flex flex-col mt-6">
          <a href="#" className="py-2 transition-colors duration-300 ease-in-out hover:text-teal-300">
            Home
          </a>
          <a href="#" className="py-2 transition-colors duration-300 ease-in-out hover:text-teal-300">
            Shop
          </a>
        </nav>
      </div>
    </div>
  );
}

export default Sidebar;
